ation and format of the Azure Blob Storage files. The location is the folder","-- under the root directory of the Azure Storage Blob.","","--DimAccount","CREATE EXTERNAL TABLE [asb].DimAccount","(","\t[AccountKey] [int] NOT NULL,","\t[ParentAccountKey] [int] NULL,","\t[AccountLabel] [nvarchar](100) NULL,","\t[AccountName] [nvarchar](50) NULL,","\t[AccountDescription] [nvarchar](50) NULL,","\t[AccountType] [nvarchar](50) NULL,","\t[Operator] [nvarchar](50) NULL,","\t[CustomMembers] [nvarchar](300) NULL,","\t[ValueType] [nvarchar](50) NULL,","\t[CustomMemberOptions] [nvarchar](200) NULL,","\t[ETLLoadID] [int] NULL,","\t[LoadDate] [datetime] NULL,","\t[UpdateDate] [datetime] NULL",")","WITH","(","    LOCATION='/DimAccount/'",",   DATA_SOURCE = AzureStorage_west_public",",   FILE_FORMAT = TextFileFormat",",   REJECT_TYPE = VALUE",",   REJECT_VALUE = 0",")",";","","--DimChannel","CREATE EXTERNAL TABLE [asb].DimChannel","(","\t[ChannelKey] [int] NOT NULL,","\t[ChannelLabel] [nvarchar](100) NOT NULL,","\t[ChannelName] [nvarchar](20) NULL,","\t[ChannelDescription] [nvarchar](50) NULL,","\t[ETLLoadID] [int] NULL,","\t[LoadDate] [datetime] NULL,","\t[UpdateDate] [datetime] NULL",")","WITH","(","    LOCATION='/DimChannel/'",",   DATA_SOURCE = AzureStorage_west_public",",   FILE_FORMAT = TextFileFormat",",   REJECT_TYPE = VALUE",",   REJECT_VALUE = 0",")",";","","--DimCurrency","CREATE EXTERNAL TABLE [asb].DimCurrency","(","\t[CurrencyKey] [int] NOT NULL,","\t[CurrencyLabel] [nvarchar](10) NOT NULL,","\t[CurrencyName] [nvarchar](20) NOT NULL,","\t[CurrencyDescription] [nvarchar](50) NOT NULL,","\t[ETLLoadID] [int] NULL,","\t[LoadDate] [datetime] NULL,","\t[UpdateDate] [datetime] NULL",")","WITH","(","    LOCATION='/DimCurrency/'",",   DATA_SOURCE = AzureStorage_west_public",",   FILE_FORMAT = TextFileFormat",",   REJECT_TYPE = VALUE",",   REJECT_VALUE = 0",")",";","","--DimCustomer","CREATE EXTERNAL TABLE [asb].DimCustomer","(","\t[CustomerKey] [int]  NOT NULL,","\t[GeographyKe